import React, { Component } from 'react';

class MyList extends Component {
    constructor(props) {

        this.state = {
            myList: [ 1, 2, 3 ],
        };
    }

    render() {
        return (
            <ol>
            {this.state.myList.map((item) => {
                return <li>{item}</li>
            })}
            </ol>
        )
    }
}

export default MyList
